import React from "react";
import './Index.css';
import { useNavigate } from "react-router-dom";

const IndexPage = () => {
  const navigate = useNavigate();

  const handleLoginClick = () => {
    navigate("/login");
  };

  return (
    <div className="index-container">
      <h1>Welcome to Our SaaS Platform</h1>
      <p>
        Unlock the full potential of your projects with our intuitive and powerful tools. Let's make things easier together!
      </p>
      <button onClick={handleLoginClick} className="get-started-button">
        Get Started
      </button>
    </div>
  );
};

export default IndexPage;
